import React from 'react';
import { Link } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.css';
import 'owl.carousel/dist/assets/owl.carousel.css';
import 'owl.carousel/dist/assets/owl.theme.default.css';

export const AddJobDocument = () => {
  return (
    <>
    <section className="masthead">
   <div className="container">
      <div className="row">
      <div className="col-md-12">
            <h5 className="mb-4">Jobs &#62; Add New Job Post</h5>
         </div>
      <div className="col-md-10 mb-4">
        <Link className="btn-add" to="/"><i className="fa fa-comments"></i> Join 2.4k Chatters</Link>
         </div>
         <div className="col-md-2">
         <Link className="btn-add" to="/CreateNewPost"><i className="fa fa-plus-circle"></i> Add New Post</Link>
         </div>
      </div>
   </div>
</section>
    </>
  )
}

export default AddJobDocument;
